import { service as graphqlService } from '../service/graphql'
import { service as firebaseService } from '../service/firebase'
import { createAddCard } from '../usecase/AddCard'
import { createAddTopic } from '../usecase/AddTopic'
import { createGetCurrentUser } from '../usecase/GetCurrentUser'
import { createGetTopic } from '../usecase/GetTopic'
import { createGetTopics } from '../usecase/GetTopics'
import { createGetTopicsObserver } from '../usecase/GetTopicsObserver'
import { createGetUserToken } from '../usecase/GetUserToken'
import { createLoginWithProvider } from '../usecase/LoginWithProvider'
import { createRemoveTopic } from '../usecase/RemoveTopic'
import { createUserObserver } from '../usecase/UserObserver'

const addCard = createAddCard(graphqlService)
const addTopic = createAddTopic(graphqlService)
const getCurrentUser = createGetCurrentUser(firebaseService)
const getTopic = createGetTopic(graphqlService)
const getTopics = createGetTopics(graphqlService)
const getTopicsObserver = createGetTopicsObserver(graphqlService)
const getUserToken = createGetUserToken(firebaseService)
const loginWithProvider = createLoginWithProvider(firebaseService)
const removeTopic = createRemoveTopic(graphqlService)
const userObserver = createUserObserver(firebaseService)

export {
  addCard,
  addTopic,
  getCurrentUser,
  getTopic,
  getTopics,
  getTopicsObserver,
  getUserToken,
  loginWithProvider,
  removeTopic,
  userObserver,
}
